import React, { useState,useEffect } from "react";
import myData from "../data.json";




const Idahodata = () => {
    const productlist = myData.IdahoproList
    console.log(productlist)
        return (
            <>
            {productlist.map((dataIn) => 
            <ul>
                <h4 key={dataIn.id}>{dataIn.name}</h4>
                <div>
                {dataIn.yearlyvariations.map((vari) => 
                    <li>{vari.title}</li>
                    )}
                    </div>
            </ul>
            )}
            </>
        );
  
   
};
export default Idahodata;
